import { useEffect, useState , useContext} from "react"
import MyContext from "./context"

export default function Child(props){
    const [state, setState] = useState(false)

    const { contextState, setContextState } = useContext(MyContext);


    useEffect(()=>{console.log('child rerender')})
    return(
        <div> 
            <h3>Iam child of parent</h3>
            <button onClick={()=>props.arg(!state,'running by child')}>Change State</button>

            <p>Context State -: {contextState}</p>
            <button onClick={()=>setContextState('context value Changed')}></button> 

        </div>

    )
}
